function chart() {
  const data = {
    labels: [],
    datasets: [
      {
        label: '',
        backgroundColor: 'rgb(255, 99, 132)',
        borderColor: 'rgb(255, 99, 132)',
        data: [],
      },
    ],
  };

  const config = {
    type: 'line',
    data: data,
    options: {},
  };
  return (
    //para crear el gráfico tiene que pasarle el nodo
    <div>
      <canvas id="myChart"></canvas>
    </div>
  );
}

export default chart;
